    public int lengthOfLongestSubstring1(String s) {
        if(s.length() == 0){
            return 0;
        }
        if(s.length() == 1){
            return 1;
        }
        //两个指针指向子串的首尾，向后滑动
        int begin=0, end=1;
        int cnt = 1, rs = 1;
        //尾指针没有移动到最后
        for( ; end<s.length(); end++){
            int t = begin;
            //尾指针指向的字符在前面没有出现过
            while(s.charAt(end) != s.charAt(t++)){}
            //尾指针指向的字符在前面没有出现过，子串的就包含进尾指针指向的字符
            if(t > end){
                cnt++;
                if(cnt>rs){
                    rs = cnt;
                }
            } else {
                //尾指针指向的字符在前面出现过，则首指针移动到重复字符的后面
                begin = t;
                cnt = end-begin+1;
            }
        }
        //返回最终的字符数
        return rs;
    }
